are used as coating materials, matrix formers and/or packaging materials for agrochemicals.

A super-regenerative transceiver that has an antenna interface for an antenna is self-tuned with a self-tuning unit configured. The self-tuning unit makes the transceiver to repeatedly perform a self-tuning cycle until the amplitude meets a predetermined detection condition or a predetermined criterion is met. The self-tuning cycle involves the following steps: 
transmitting to the antenna a probe signal with one or more pulses; 
receiving from the antenna a ringing detection signal; 
determining if the ringing detection signal reflects tails of the probe signal with amplitude meeting a predetermined detection condition; and 
adjusting of the tuning of the super-regenerative transceiver if the amplitude does not meet the predetermined detection condition.
